script1:
// This is for two fields, you can add as my fields as you require using the same format
    // Just make sure you give different variable names
    msc = "competitive, daring, aggressive, courageous, dominant, unexcitable, stands up under pressure";
    msc = msc.split(",");
    r1 = Math.floor(Math.random() * msc.length);

    // Store the selected named and remove it from the list
    property1 = msc[r1].trim();
    msc.splice(r1, 1);

    // Regenerate Random number for the second name, otherwise you'll always get the same combination
    r1 = Math.floor(Math.random() * msc.length);
    property2 = msc[r1].trim();
 msc.splice(r1, 1);

 // Regenerate Random number for the third name
 r1 = Math.floor(Math.random() * msc.length);
    property3 = msc[r1].trim();
 msc.splice(r1, 1);

 // Now fem
 fem = "affectionate, sympathetic, gentle, sensitive, supportive, kind, nurturing, warm";
    fem = fem.split(",");
    r2 = Math.floor(Math.random() * fem.length);

   // Store the selected named and remove it from the list
    property4 = fem[r1].trim();
    fem.splice(r2, 1);

   // Store the selected named and remove it from the list
    r2 = Math.floor(Math.random() * fem.length);
 property5 = fem[r2].trim();
    fem.splice(r2, 1);

 // Store the selected named and remove it from the list
     r2 = Math.floor(Math.random() * fem.length);  
 property6 = fem[r2].trim();
    fem.splice(r2, 1);


    // Build the sentence to be used. Everything "inside quotes" is static
    sentence = property1 + ", " + property2 + ", " + property3 + ", " + property4 + ", " + property5 + ", " + property6  

    // Insert this sentence into the question
    document.querySelector("#mysentence").innerText = sentence;

